import axios from 'axios'
// import getdataReducer from 'Store/Reducers/getData'

export const getPoolsData = () => {

        return dispatch=>{ axios.request({
            method: 'GET',
            url: 'http://localhost:8000/pools/powerball',
            headers: {
                'Access-Control-Expose-Headers': 'Access-Control-Allow-Origin',
                // 'Access-Control-Allow-Origin': '*',
                Accept: "application/json",
                "Content-Type": "application/json"
            }
        })
            .then(response => (
                dispatch({
                    type:"GET_MEGA_DATA",
                    state: response
                })
            ))
    }
}

export const getMegaData = () => {  
        return dispatch=>{axios.request({
            method: 'GET',
            url: 'http://localhost:8000/pools/megamillion',
            headers: {
                'Access-Control-Expose-Headers': 'Access-Control-Allow-Origin',
                // 'Access-Control-Allow-Origin': '*',
                Accept: "application/json",
                "Content-Type": "application/json"
            }
        })
            .then(response => (
                dispatch({
                    type:"GET_MEGA_DATA",
                    state: response
                })
            ))
        }

    }
